import NavIcon from "./NavIcon";
const NavBar = (props) => {
  return (
    <div class="d-flex justify-content-between p-3">
      <div>
        <p className="text-danger fw-b">Movie App</p>
      </div>
      <div>
        <NavIcon></NavIcon>
      </div>
    </div>
  );
};
export default NavBar;
